    return (
      <div>
        <CardMedia className="image-product" image={require("../images/detail-black.jpg")} />
        <Grid container direction="row">
          <Button>

          </Button>
        </Grid>
        <Divider style={{ height: 1, color: "black" }} />
        <h2>Product Information:</h2>
      </div>
    );
  }
}

